struct Event: Decodable {
  var id: String
  var type: String
  var actor: Actor
  var repo: Repo
  var payload: Payload
  var created_at: String
  
  struct Actor: Decodable {
    var id: Int
    var login: String
    var display_login: String
    var avatar_url: String
  }
  
  struct Repo: Decodable {
    var id: Int
    var name: String
    var url: String
  }
  
  struct Payload: Decodable {
    var ref_type: String?
    var action: String?
    var member: Member?
    var forkee: Forkee?
  }
  
  struct Member: Decodable {
    var login: String
    var avatar_url: String
  }
  
  struct Forkee: Decodable {
    var id: Int
    var name: String
    var full_name: String
  }
}

class FakeDataProvider {
  func providerData() -> [Event] {
    let data = jsonString.data(using: .utf8)!
    return data.jsonDataMapModel([Event].self)!
  }
}

extension Data {
  func jsonDataMapModel<T: Decodable>(_ type: T.Type) -> T? {
    let decoder = JSONDecoder()    
    do {
      return try decoder.decode(T.self, from: self)
    } catch {
      print(error)
      return nil
    }
  }
}
